import React,{Component} from 'react';

class Form extends Component{
    constructor(props){
        super(props)

        this.state={
            username:''
        }
    }
   render(){
       return(
              <form>
                  <div>
                      <label>username: </label>
                      <input type='text'value={this.state.username}/>
                  </div>
              </form>
       )
   }
}

export default Form;
